def Power(x,n):
	return x**n
def lam(a,b,c):
	return a**2 + b**2 + c**2 -2*a*b - 2*b*c - 2*a*c
def Sqrt(x):
	return np.sqrt(x)

class cascade(vg.BatchIntegrand):

	def __init__(self, dim, Emin, Emax, MC_case):
		self.dim = dim
		self.Emax = Emax
		self.Emin = Emin
		self.MC_case = MC_case
		self.flux = MC_case.flux
				
	def __call__(self, x, jac):

		MA = self.MC_case.MA
		Z = self.MC_case.Z
		params = self.MC_case.params
		

		Mzprime = params.Mzprime
		if self.MC_case.nu_produced==pdg.neutrino4:
			Mn = params.m4
		elif self.MC_case.nu_produced==pdg.neutrino5:
			Mn = params.m5
		else:
			print("Could not specify upscattered neutrino mass.")
		

		m_ell = self.MC_case.m_ell
		alphaD = params.gprime**2/4.0/np.pi
		Umu4 = params.Umu4
		epsilon = params.chi * const.cw
		UD4     = params.UD4

		########################
		# Get range of mass parameters for KDE scan
		jacobian_scan = 1
		if params.scan:
			Mn = (params.M4_max-params.M4_min) * x[:,-1] + params.M4_min
			Mzprime = (np.minimum(params.mzprime_max,Mn)-params.mzprime_min) * x[:,-2] + params.mzprime_min
			jacobian_scan *= (params.M4_max-params.M4_min)*(np.minimum(params.mzprime_max,Mn)-params.mzprime_min)#/jac[:,-1]/jac[:,-2]



		Emin = 1.05*(Mn**2/2.0/MA + Mn)
		Enu = (self.Emax - Emin) * x[:, 1] + Emin

		#######################
		# Upscattering N decay

		s = MA**2 + 2*Enu*MA

		E1CM = (s - MA**2)/2.0/np.sqrt(s)
		E3CM = (s + Mn**2 - MA**2)/2.0/np.sqrt(s)

		p1CM = E1CM # massless
		p3CM = np.sqrt(E3CM**2 - Mn**2)

		# Q2lmin = np.log(-(Mn**2 - 2 *  E1CM*(E3CM - p3CM) ))
		# Q2lmax = np.log(-(Mn**2 - 2 *  E1CM*(E3CM + p3CM)))
		Q2lmin = np.log(-(Mn*Mn- 2 * ( E1CM*E3CM - p1CM*p3CM) ))
		Q2lmax = np.log(-(Mn*Mn- 2 * ( E1CM*E3CM + p1CM*p3CM)))

		Q2l = (Q2lmax - Q2lmin) * x[:, 0] + Q2lmin
		Q2 = np.exp(Q2l)

		u = 2*MA**2 + Mn**2 - s + Q2

		# Start sigma
		dsigma = 1.0

		# BSM parameters
		dsigma *= Umu4**2*alphaD*4.0*np.pi/4.0
		dsigma *= epsilon**2

		# Z' propagator
		dsigma *= 1.0/(Q2 + Mzprime**2)**2

		# Hadronic tensor coupling
		dsigma *= Power(const.eQED,2)

		if Z == 1:
			F1 = const.F1_EM(Q2)#F1_SM(Q2)
			F2 = const.F2_EM(Q2)#F2_SM(Q2)
			FA = 0
			dsigma *= 16*Power(Enu,2)*(4*(Power(F1,2) + Power(FA,2))*Power(MA,2) + Power(F2,2)*Q2) + ((Power(Mn,2) + Q2)*(-16*(F1 - FA)*(F1 + FA)*Power(MA,4) - 4*F2*(2*F1 + F2)*Power(MA,2)*Power(Mn,2) + 4*(2*Power(F1,2) + Power(F2,2) + 4*F2*FA + 2*Power(FA,2) + 4*F1*(F2 + FA))*Power(MA,2)*Q2 + Power(F2,2)*Power(Mn,2)*Q2))/Power(MA,2) - (8*Enu*(8*F1*FA*Power(MA,2)*Q2 + 8*F2*FA*Power(MA,2)*Q2 + 4*Power(F1,2)*Power(MA,2)*(Power(Mn,2) + Q2) + 4*Power(FA,2)*Power(MA,2)*(Power(Mn,2) + Q2) + Power(F2,2)*Q2*(Power(Mn,2) + Q2)))/MA
			# dsigma *= 16*F2*FA*Q2*(2*Power(MA,2) + Power(Mn,2) + Q2 - 2*s) + 8*F1*(4*FA*Power(MA,2)*Q2 - (Power(Mn,2) + Q2)*(F2*Power(Mn,2) - 2*(F2 + FA)*Q2) - 4*FA*Q2*s) + 8*Power(FA,2)*(2*Power(MA,4) + Q2*(Power(Mn,2) + Q2) + 4*Power(MA,2)*(Power(Mn,2) + Q2 - s) - 2*(Power(Mn,2) + Q2)*s + 2*Power(s,2)) + 8*Power(F1,2)*(Q2*(Power(Mn,2) + Q2) + 2*(Power(MA,4) - (2*Power(MA,2) + Power(Mn,2) + Q2)*s + Power(s,2))) + (Power(F2,2)*(4*Power(MA,4)*Q2 - 4*Power(MA,2)*(Power(Mn,4) - Power(Mn,2)*Q2 + 2*Q2*(-Q2 + s)) + Q2*(Power(Mn,4) + Power(Mn,2)*(Q2 - 4*s) + 4*s*(-Q2 + s))))/Power(MA,2)

		else:
			F1 = const.FEMcoh(np.sqrt(Q2),MA)
			F2 = 0
			FA = 0
			dsigma *= Z*Z*4.0*Power(F1,2)*(4*Power(MA,4) + Power(Mn,4) + Power(Mn,2)*Q2 - 4*(2*Power(MA,2) + Power(Mn,2) + Q2)*s + 4*Power(s,2))
			# dsigma *= Z*Z*4*Power(F1,2)*(4*Power(MA,4) + Power(Mn,4) + Power(Mn,2)*Q2 - 4*(2*Power(MA,2) + Power(Mn,2) + Q2)*s + 4*Power(s,2))
			
		betaPS = np.sqrt(1.0 - 2*(Mn**2 + MA**2)/s + (Mn**2 - MA**2)**2/s**2)
		dsigma *= betaPS/(32.0*np.pi**2)
		
		dsigma *= 1.0/(4.0*Enu*MA) 
		dsigma *= 1.0/2.0/p1CM/p3CM

		# Integrated over phi 
		dsigma *= 2*np.pi
		dsigma *= (Q2lmax - Q2lmin)*np.exp(Q2l)
		dsigma *= (self.Emax - Emin)

		#######################
		## Heavy N Decay
		cost = -1.0 + (2.0) * x[:, 2]
		dgamma = 2*UD4**2*(params.Ue4**2 + params.Umu4**2 + params.Utau4**2)*alphaD*4*np.pi*(Mn**2 - 2*Mzprime**2 + Mn**4/Mzprime**2)/2.0/Mn/32.0/np.pi**2*(1.0-Mzprime**2/Mn**2) 
	
		############# If Dirac, include angular dependence ###################
		if params.D_or_M == 'dirac':
			dgamma *= ( 1.0 - (Mn**2 - 2*Mzprime**2)/(Mn**2 + 2*Mzprime**2)*cost)/2.0
		dgamma*= np.ones(len(cost))
		################################

		dgamma *= 2*np.pi 
		dgamma *= 2 # Jacobian

		#######################
		## Zprime decay 
		dgammaZprime = (const.alphaQED*(epsilon*epsilon)*np.sqrt(-4*(m_ell*m_ell) + Mzprime*Mzprime)*(5*(m_ell*m_ell) + 2*(Mzprime*Mzprime))*np.pi)/(24.*(Mzprime*Mzprime)*(np.pi*np.pi))
		dgammaZprime *= 2*np.pi*2 # integral over angles


		#############
		# return {'full integrand' : const.GeV2_to_cm2*dsigma*self.flux(Enu)*dgamma*dgammaZprime*jacobian_scan,
		# 		'decay rate N' : dgamma*dgammaZprime*jacobian_scan/jac[:,0]/jac[:,1],
		# 		'cross section' : const.GeV2_to_cm2*dsigma*jacobian_scan/jac[:,2]}



		# #############
		return {'full integrand' : const.GeV2_to_cm2*dsigma*self.flux(Enu)*dgamma*dgammaZprime*jacobian_scan*Mzprime**2/Mn**3.5,
				'decay rate N' : dgamma*dgammaZprime*jacobian_scan*Mzprime**2/Mn**3.5/jac[:,0]/jac[:,1],
				'cross section' : const.GeV2_to_cm2*dsigma*jacobian_scan/jac[:,2]}



class threebody(vg.BatchIntegrand):

			def __init__(self, dim, Emin, Emax, MC_case):
				self.dim = dim
				self.Emax = Emax
				self.Emin = Emin
				self.MC_case = MC_case
				self.flux = MC_case.flux
				params = MC_case.params
				final_lepton1 = MC_case.final_lepton
				final_lepton2 = MC_case.final_lepton
				self.h_upscattered = MC_case.h_upscattered

				if (MC_case.final_lepton==pdg.tau):
					self.CC_mixing = MC_case.params.Utau4
				elif(MC_case.final_lepton==pdg.muon):
					self.CC_mixing = MC_case.params.Umu4
				elif(MC_case.final_lepton==pdg.electron):
					self.CC_mixing = MC_case.params.Ue4
				else:
					print("WARNING! Unable to set CC mixing parameter for decay. Assuming 0.")
					self.CC_mixing = 0

				self.NCflag=1
				if MC_case.nu_produced==pdg.neutrino6:
					self.mh = params.m6


					###########################33
					# THESE ENTER INTO SCATTERING
					self.cij=params.Umu6*const.gweak/2.0/const.cw
					self.cji=self.cij
					self.dij=params.UD6*params.Umu6*params.gprime
					self.dji=self.dij

					# Which outgoing neutrino?
					if MC_case.nu_outgoing==pdg.nue:
						self.Cih = params.ce6
						self.Dih = params.de6
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.numu:
						self.Cih = params.cmu6
						self.Dih = params.dmu6
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.nutau:
						self.Cih = params.ctau6
						self.Dih = params.dtau6
						self.mf = 0.0
					elif MC_case.nu_outgoing==const.neutrino_light:
						self.Cih = params.clight6
						self.Dih = params.dlight
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.neutrino4:
						self.Cih = params.c46
						self.Dih = params.d46
						self.mf = params.m4
					elif MC_case.nu_outgoing==pdg.neutrino5:
						self.Cih = params.c56
						self.Dih = params.d56
						self.mf = params.m5
				
				elif MC_case.nu_produced==pdg.neutrino5:
					self.mh = params.m5

					###########################33
					# THESE ENTER INTO SCATTERING
					self.cij=params.Umu5*const.gweak/2.0/const.cw
					self.cji=self.cij
					self.dij=params.UD5*params.Umu5*params.gprime
					self.dji=self.dij

					# Which outgoing neutrino?
					if MC_case.nu_outgoing==pdg.nue:
						self.Cih = params.ce5
						self.Dih = params.de5
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.numu:
						self.Cih = params.cmu5
						self.Dih = params.dmu5
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.nutau:
						self.Cih = params.ctau5
						self.Dih = params.dtau5
						self.mf = 0.0
					elif MC_case.nu_outgoing==const.neutrino_light:
						self.Cih = params.clight5
						self.Dih = params.dlight5
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.neutrino4:
						self.Cih = params.c45
						self.Dih = params.d45
						self.mf = params.m4

				elif MC_case.nu_produced==pdg.neutrino4:
					self.mh = params.m4

					###########################33
					# THESE ENTER INTO SCATTERING
					self.cij=params.Umu4*const.gweak/2.0/const.cw
					self.cji=self.cij
					self.dij=params.UD4*params.Umu4*params.gprime
					self.dji=self.dij


					# Which outgoing neutrino?
					if MC_case.nu_outgoing==pdg.nue:
						self.Cih = params.ce4
						self.Dih = params.de4
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.numu:
						self.Cih = params.cmu4
						self.Dih = params.dmu4
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.nutau:
						self.Cih = params.ctau4
						self.Dih = params.dtau4
						self.mf = 0.0
					elif MC_case.nu_outgoing==const.neutrino_light:
						self.Cih = params.clight4
						self.Dih = params.dlight4
						self.mf = 0.0
					elif MC_case.nu_outgoing==pdg.neutrino4:
						print('ERROR! (nu4 -> nu4 l l) is kinematically not allowed!')
				


				################################################
				# DECIDE ON CHARGED LEPTON
				if MC_case.nu_outgoing/10==final_lepton1:
					# Mixing required for CC N-like
					if (final_lepton1==pdg.tau):
						self.CC_mixing1 = params.Utau4
					elif(final_lepton1==pdg.muon):
						self.CC_mixing1 = params.Umu4
					elif(final_lepton1==pdg.electron):
						self.CC_mixing1 = params.Ue4
					else:
						print("WARNING! Unable to set CC mixing parameter for decay. Assuming 0.")
						self.CC_mixing1 = 0

					# Mixing required for CC Nbar-like
					if (final_lepton2==pdg.tau):
						self.CC_mixing2 = params.Utau4
					elif(final_lepton2==pdg.muon):
						self.CC_mixing2 = params.Umu4
					elif(final_lepton2==pdg.electron):
						self.CC_mixing2 = params.Ue4
					else:
						print("WARNING! Unable to set CC mixing parameter for decay. Assuming 0.")
						self.CC_mixing2 = 0
				else:
					self.CC_mixing1 = 0
					self.CC_mixing2 = 0
				
				#######################################
				### WATCH OUT FOR THE MINUS SIGN HERE -- IMPORTANT FOR INTERFERENCE
				## Put required mixings in CCflags
				self.CCflag1 = self.CC_mixing1
				self.CCflag2 = -self.CC_mixing2

				##############################
				# CHARGED LEPTON MASSES 

				if (final_lepton1==pdg.tau):
					self.mm = const.Mtau
				elif(final_lepton1==pdg.muon):
					self.mm = const.Mmu
				elif(final_lepton1==pdg.electron):
					self.mm = const.Me
				else:
					print("WARNING! Unable to set charged lepton mass. Assuming massless.")
					self.mm = 0

				if (final_lepton2==pdg.tau):
					self.mp = const.Mtau
				elif(final_lepton2==pdg.muon):
					self.mp = const.Mmu
				elif(final_lepton2==pdg.electron):
					self.mp = const.Me
				else:
					print("WARNING! Unable to set charged lepton mass. Assuming massless.")
					self.mp = 0


			def __call__(self, x, jac):

				g = const.g			
				gweak = const.g	
				MZBOSON = const.Mz
				cw = const.cw
				MW = const.Mw
				pi = np.pi

				cij = self.cij
				cji = self.cji
				dij = self.dij
				dji = self.dji

				params = self.MC_case.params
				MA = self.MC_case.MA
				Z = self.MC_case.Z
				Mn = self.MC_case.Mn
				Mn_outgoing = self.MC_case.Mn_outgoing
				Mzprime = params.Mzprime
                
				jacobian_scan = 1
				if params.scan:
					Mn = (params.M4_max-params.M4_min) * x[:,-1] + params.M4_min
					Mzprime = (params.mzprime_max-np.maximum(Mn,params.mzprime_min))* x[:,-2] + np.maximum(Mn,params.mzprime_min)
					jacobian_scan *= (params.M4_max-params.M4_min)*(params.mzprime_max-np.maximum(Mn,params.mzprime_min))#/jac[:,-1]/jac[:,-2]
                    
				Emin = 1.05*(Mn**2/2.0/MA + Mn)
				Enu = (self.Emax - Emin) * x[:, 1] + Emin

				s = MA**2 + 2*Enu*MA

				E1CM = (s - MA**2)/2.0/np.sqrt(s)
				E3CM = (s + Mn**2 - MA**2)/2.0/np.sqrt(s)

				p1CM = E1CM # massless
				p3CM = np.sqrt(E3CM**2 - Mn**2)


				# Q2 log
				# Q2lmin = np.log(-(Mn**2 - 2 * ( E1CM*E3CM - p1CM*p3CM) ))
				# Q2lmax = np.log(-(Mn**2 - 2 * ( E1CM*E3CM + p1CM*p3CM)))

				# Q2l = (Q2lmax - Q2lmin) * x[:, 0] + Q2lmin
				# Q2 = np.exp(Q2l)

				# Q2 log
				Q2min = -(Mn**2 - 2 * ( E1CM*E3CM - p1CM*p3CM))
				Q2max = -(Mn**2 - 2 * ( E1CM*E3CM + p1CM*p3CM))
				Q2 = (Q2max - Q2min) * x[:, 0] + Q2min


				if Z == 1:

					M=MA
					mHNL=Mn
					Mzprime=Mzprime
					g = const.g
					pi=np.pi
					mzprime=Mzprime
					MZPRIME=Mzprime

					FFf1=const.F1_EM(Q2)#const.F1_WEAK(Q2)
					FFf2=const.F2_EM(Q2)#const.F2_WEAK(Q2)
					FFga=0.0#const.F3_WEAK(Q2)
					FFgp=0.0
					EMf1=const.F1_EM(Q2)#const.F1_WEAK(Q2)
					EMf2=const.F2_EM(Q2)#const.F2_WEAK(Q2)
					EMga=0.0#const.F3_WEAK(Q2)
					EMgp=0.0

					Wf1=const.F1_WEAK(Q2)
					Wf2=const.F2_WEAK(Q2)
					Wga=const.F3_WEAK(Q2)
					Wgp=0.0

					deV = const.eQED*params.epsilon
					dWV = (1.0-4.0*const.s2w)*Z-(MA/const.MAVG - Z)

					t = -Q2

					h = self.h_upscattered
					

					# Dirac
